import { ImageView } from "./ImageView"
import React from "react"


interface Props {
    imageUrlApends: string[]
    onDeleteHandler: (imageAppendix: string) => void
}

export const ImageList: React.FC<Props> = (props) => {

    return (<div style={{}}>
        {props.imageUrlApends.map(
            (imageUrlAppendix, index) => {
                return <ImageView key={index} imageUrlAppendix={imageUrlAppendix} size={"default"} handleDelete={props.onDeleteHandler}></ImageView>
            } 
        )}

    </div>)
}
